        protected override void NewSearch()
        {
            base.NewSearch();

            edtSucheName.EditValue = 1;
            edtSucheStrasse.EditValue = 1;
            edtSucheOrt.EditValue = 1;
            edtSucheNurMitZahlungsinfo.EditValue = true;
        }

        #endregion

        #region Private Methods

        private void CtlQuerySysDoppelteInstitutionen_Load(object sender, System.EventArgs e)
        {
            SqlQuery qry = DBUtil.OpenSQL(@"
              select Code = convert(int,null), Text = convert(varchar(20),null)
              union all
              select 1, 'ähnlich'
              union all
              select 2, 'genau gleich'");

            edtSucheName.Properties.DataSource = qry;
            edtSucheStrasse.Properties.DataSource = qry;
            edtSucheOrt.Properties.DataSource = qry;
            edtSucheTelefon.Properties.DataSource = qry;
        }

        #endregion
    }
}